        return (0, y + x)

def find_billiards_collision_point(N, K, x, y):
    if x == y:
        return (N, N)
    if x > y:
        if K % 4 == 1:
            return (N, y - x + N)
        elif K % 4 == 2:
            return (y - x + N, N)
        elif K % 4 == 3:
            return (0, x - y)
        else:
            return (x - y, 0)
    elif K % 4 == 1:
        return (x - y + N, N)
    elif K % 4 == 2:
        return (N, x - y + N)
    elif K % 4 == 3:
        return (y - x, 0)
    else:
        return (0, y * x)
